js_webassert_test.js_webassert_test_form:
  path: '/js_webassert_test_form'
  defaults:
    _form: '\Drupal\js_webassert_test\Form\JsWebAssertTestForm'
    _title: 'JsWebAssertForm'
  requirements:
    _access: 'TRUE'

js_webassert_test.js_webassert_test_page:
  path: '/js_webassert_test_page'
  defaults:
    _controller: '\Drupal\js_webassert_test\Controller\TestController::page'
    _title: 'JsWebAssertPage'
  requirements:
    _access: 'TRUE'
